          "name": {
              "text": "Tegan and Sara: High School Signing",
              "html": "Tegan and Sara: High School Signing"
          },
          "description": {
              "text": "Tegan and Sara join us to sign (no personalizations) copies of their new memoir High School! Ticket includes a copy of High School and the opportunity to take a photo with Tegan and Sara.\nHigh School is the revelatory coming-of-age story of Sara and Tegan Quin, identical twins from Calgary, Alberta, who grew up during the peak of grunge and rave culture in the nineteen-nineties. Before they became the celebrated musicians and global LGBTQ icons we know today, Tegan and Sara skipped school, dropped acid, snuck out of the house, and fell in and out of love for the first time — sometimes with their best friends. Written in alternating chapters from Tegan's and Sara’s points of view, High School captures the discordant and parallel memories of two sisters struggling to understand their identities and beginning to see themselves, for the first time, as artists.\n",
              "html": "<P>Tegan and Sara join us to sign (no personalizations) copies of their new memoir High School! Ticket includes a copy of High School and the opportunity to take a photo with Tegan and Sara.</P>\n<P><EM>High School</EM><SPAN> is the revelatory coming-of-age story of Sara and Tegan Quin, identical twins from Calgary, Alberta, who grew up during the peak of grunge and rave culture in the nineteen-nineties. Before they became the celebrated musicians and global LGBTQ icons we know today, Tegan and Sara skipped school, dropped acid, snuck out of the house, and fell in and out of love for the first time — sometimes with their best friends. Written in alternating chapters from Tegan's and Sara’s points of view,</SPAN><SPAN> </SPAN><EM>High School</EM><SPAN> captures the discordant and parallel memories of two sisters struggling to understand their identities and beginning to see themselves, for the first time, as artists.</SPAN></P>\n<P><BR></P>"
          },
