          "name": {
              "text": "Reading California Book Discussion: Fruit of the Drunken Tree ",
              "html": "Reading California Book Discussion: Fruit of the Drunken Tree "
          },
          "description": {
              "text": "Silver medalist of this year's California Book Awards, Fruit of the Drunken Tree by Ingrid Rojas Contreras, is a novel about life in crime-ridden, violent Bogota, Colombia and was inspired by the author's own life. It’s told through the eyes of the two teenage female protagonists. Author Rojas Contreras will enhance the discussion, joining us to give her input on writing the book. Our discussion should prove lively and rewarding. Join us!\nLocation: 110 The Embarcadero, Max Thelen Boardroom, San Francisco Time: 5:30 p.m. check-in, 6 p.m. program MLF: Reading Californians Program organizer: Kalena Gregory\nAll ticket sales are final and nonrefundable.",
              "html": "<P CLASS=\"p1\"><SPAN CLASS=\"s1\">Silver medalist of this year's California Book Awards, <I>Fruit of the Drunken Tree </I>by Ingrid Rojas Contreras, is a novel about life in crime-ridden, violent Bogota, Colombia and was inspired by the author's own life. It’s told through the eyes of the two teenage female protagonists. Author Rojas Contreras will enhance the discussion, joining us to give her input on writing the book. Our discussion should prove lively and rewarding. Join us!</SPAN></P>\n<P CLASS=\"p1\"><SPAN CLASS=\"s1\"><STRONG>Location:</STRONG> 110 The Embarcadero, Max Thelen Boardroom, San Francisco<BR> <STRONG>Time: </STRONG>5:30 p.m. check-in, <STRONG>6 p.m. program</STRONG><BR> <STRONG>MLF:</STRONG> Reading Californians<BR> <STRONG>Program organizer:</STRONG> Kalena Gregory</SPAN></P>\n<P CLASS=\"p1\"><STRONG>All ticket sales are final and nonrefundable.</STRONG></P>"
          },
