          "name": {
              "text": "Humanities West Book Discussion: The Wind That Swept Mexico ",
              "html": "Humanities West Book Discussion: The Wind That Swept Mexico "
          },
          "description": {
              "text": "Join us to discuss The Wind That Swept Mexico: The History of the Mexican Revolution of 1910–1942. The Mexican Revolution began in 1910 with the overthrow of dictator Porfirio Díaz. The Wind That Swept Mexico, originally published in 1943, was the first book to present a broad account of that revolution in its several different phases. In concise but moving words and in memorable photographs, this classic sweeps the reader along from the false peace and plenty of the Díaz era through the doomed administration of Madero, the chaotic years of Villa and Zapata, Carranza and Obregón, to the peaceful social revolution of Cárdenas and Mexico's entry into World War II. The photographs were assembled from many sources by George R. Leighton with the assistance of Anita Brenner and others. Many of the prints were cleaned and rephotographed by the distinguished photographer Walker Evans. Discussion led by Lynn Harris.\nLocation: 110 The Embarcadero, Max Thelen Boardroom, San Francisco Time: 6 p.m. check-in, 6:30 p.m. program  MLF: Humanities Program organizer: George HammondNotes: In association with Humanities West's program on Mexico’s artistic revolution. \nAll ticket sales are final and nonrefundable.",
              "html": "<P CLASS=\"p1\"><SPAN>Join us to discuss <I>The Wind That Swept Mexico: The History of the Mexican Revolution of 1910–1942</I>. The Mexican Revolution began in 1910 with the overthrow of dictator Porfirio Díaz. <I>The Wind That Swept Mexico</I>, originally published in 1943, was the first book to present a broad account of that revolution in its several different phases. In concise but moving words and in memorable photographs, this classic sweeps the reader along from the false peace and plenty of the Díaz era through the doomed administration of Madero, the chaotic years of Villa and Zapata, Carranza and Obregón, to the peaceful social revolution of Cárdenas and Mexico's entry into World War II. The photographs were assembled from many sources by George R. Leighton with the assistance of Anita Brenner and others. Many of the prints were cleaned and rephotographed by the distinguished photographer Walker Evans. <SPAN>Discussion led by Lynn Harris.</SPAN></SPAN></P>\n<P CLASS=\"MsoNormal\"><STRONG>Location:</STRONG><SPAN> 110 The Embarcadero, Max Thelen Boardroom, San Francisco<BR> <STRONG>Time: </STRONG>6 p.m. check-in, <STRONG><SPAN>6:30 p.m. program </SPAN></STRONG><BR> <STRONG>MLF: </STRONG>Humanities<BR> <STRONG>Program organizer</STRONG>: George Hammond<BR><STRONG>Notes: </STRONG><SPAN>In association with Humanities West's program on Mexico’s artistic revolution.</SPAN><SPAN><BR> </SPAN></SPAN></P>\n<P CLASS=\"MsoNormal\"><STRONG>All ticket sales are final and nonrefundable.</STRONG></P>"
          },
