          "name": {
              "text": "Synergetic Symposium and Salon: The Secret Drugs of Buddhism Book Launch",
              "html": "Synergetic Symposium and Salon: The Secret Drugs of Buddhism Book Launch"
          },
          "description": {
              "text": "Join us for a one-of-a-kind event exploring and celebrating the convergence of psychedelic studies and Buddhism with the launch of The Secret Drugs of Buddhism by Mike Crowley.  \nHosted by Deborah Parrish Snyder and Michael Gosney at the beautiful Haight Street Art Center in San Francisco.\nThe evening’s experiences include:\n• Sacred Ceremonies led by Mike Crowley and Erik Davis\n• Panel Discussion: Buddhism and Psychedelics\nErik Davis (Psychedelic Sangha, moderator)Allan Badiner - author, Zig Zag ZenDavid Presti - Prof. of Neurobiology, UC BerkeleyMariavittoria Mangini, PhD, FNP - CIIS Psychedlic-Assisted Therapy program\n• Mike Crowley presentation and book signing\n• Musical OfferingsSound Temple with Stephen Kent and Jeffrey Alphonsos Mooney \nDeep Jam with Mike Crowley and emergent players\nDivasonic - live electronic set\n• Visionary Art by Phaneros Gallery \n• Cash bar – wine and beer",
              "html": "<P><SPAN><SPAN>Join us for a one-of-a-kind event exploring and celebrating the convergence of psychedelic studies and Buddhism with the launch of <EM><A HREF=\"https://www.synergeticpress.com/secret-drugs-of-buddhism-by-mike-crowley\" TARGET=\"_blank\" REL=\"nofollow noopener noreferrer\">The Secret Drugs of Buddhism</A></EM> by Mike Crowley.  </SPAN></SPAN></P>\n<P>Hosted by Deborah Parrish Snyder and Michael Gosney at the beautiful <A HREF=\"https://haightstreetart.org\" TARGET=\"_blank\" REL=\"nofollow noopener noreferrer\">Haight Street Art Center</A> in San Francisco.</P>\n<P><SPAN>The evening’s experiences include:</SPAN></P>\n<P><SPAN>• Sacred Ceremonies led by Mike Crowley and Erik Davis</SPAN></P>\n<P><SPAN>• <SPAN>Panel Discussion:</SPAN> <EM>Buddhism and Psychedelics</EM></SPAN></P>\n<P><A HREF=\"https://techgnosis.com\" TARGET=\"_blank\" REL=\"nofollow noopener noreferrer\">Erik Davis</A> (Psychedelic Sangha, moderator)<BR><A HREF=\"https://www.plantteachers.com/allan-badiner/\" TARGET=\"_blank\" REL=\"nofollow noopener noreferrer\">Allan Badiner </A>- author, <EM>Zig Zag Zen</EM><BR><A HREF=\"https://psychology.berkeley.edu/people/david-e-presti\" TARGET=\"_blank\" REL=\"nofollow noopener noreferrer\">David Presti</A> - Prof. of Neurobiology, UC Berkeley<BR><A HREF=\"https://www.ciis.edu/research-centers/center-for-psychedelic-therapies-and-research/center-faculty\" TARGET=\"_blank\" REL=\"nofollow noopener noreferrer\">Mariavittoria Mangini, PhD, FNP</A> - CIIS Psychedlic-Assisted Therapy program</P>\n<P>• Mike Crowley presentation and book signing</P>\n<P><SPAN>• <SPAN>Musical Offerings</SPAN><BR><A HREF=\"https://www.hexenfest.net/sound-temple-stephen-kent-and-jeffrey-alphonsus-mooney\" TARGET=\"_blank\" REL=\"nofollow noopener noreferrer\">Sound Temple</A> with <A HREF=\"https://stephenkent.net/#about\" TARGET=\"_blank\" REL=\"nofollow noopener noreferrer\">Stephen Kent </A>and Jeffrey Alphonsos Mooney <BR></SPAN></P>\n<P>Deep Jam with <A HREF=\"http://www.takeourword.com/mikebio.html\" TARGET=\"_blank\" REL=\"nofollow noopener noreferrer\">Mike Crowley</A> and emergent players</P>\n<P><SPAN><A HREF=\"http://www.divasonic.com/\" TARGET=\"_blank\" REL=\"nofollow noopener noreferrer\">Divasonic</A> - live electronic set</SPAN></P>\n<P><SPAN>• Visionary Art by </SPAN><A HREF=\"https://www.phanerosart.com/\" TARGET=\"_blank\" REL=\"nofollow noopener noreferrer\">Phaneros Gallery </A></P>\n<P>• Cash bar – wine and beer</P>"
          },
