              "text": "American writer, artist, and designer Warren Lehrer is known internationally as a pioneer in the fields of visual literature and design authorship. Deemed an “oracle of the 21st century book” by Philip Meggs, Lehrer's work explores the vagaries and luminescence of character, the relationships between social structures and the individual, and the pathos and absurdity of life. His books include longtime Archive favorite French Fries (1984) and are widely acclaimed for capturing the shape of thought and reuniting the traditions of storytelling.\n\nLehrer will survey his journey as a writer, designer, performer, and practitioner of visual literature, including several collaborations with investigative journalist and author Dennis J Bernstein, host of KPFA's Flashpoints. Bernstein will then join Lehrer to present their new book and multimedia project, Five Oceans in a Teaspoon. A collection of short visual poems divided into 8 movements, the 300-page book sits at the center of a multi-tiered project that includes typographic animations, a traveling exhibit, and performance/readings.\n\nCopies of Five Oceans in a Teaspoon will be available for sale at the event. A book signing by Lehrer and Bernstein will follow the talk.\nDoors at 6:00pm. Presentation begins promptly at 6:30pm.\n",
              "html": "<P>American writer, artist, and designer<STRONG><SPAN> </SPAN><A HREF=\"https://warrenlehrer.com/\" TARGET=\"_blank\" REL=\"nofollow noopener noreferrer\">Warren Lehrer</A></STRONG> is known internationally as a pioneer in the fields of visual literature and design authorship. Deemed an “oracle of the 21st century book” by Philip Meggs, Lehrer's <SPAN>work explores the vagaries and luminescence of character, the relationships between social structures and the individual, and the pathos and absurdity of life. His books include longtime Archive favorite <EM>French Fries</EM> (1984) and are widely <SPAN>acclaimed for capturing the shape of thought and reuniting the traditions of storytelling.</SPAN><EM><BR></EM></SPAN></P>\n<P><BR></P>\n<P>Lehrer will survey his journey as a writer, designer, performer, and practitioner of visual literature, including several collaborations with investigative journalist and author <STRONG>Dennis J Bernstein</STRONG>, host of <A HREF=\"https://kpfa.org/program/flashpoints/\" TARGET=\"_blank\" REL=\"nofollow noopener noreferrer\">KPFA's </A><EM><A HREF=\"https://kpfa.org/program/flashpoints/\" TARGET=\"_blank\" REL=\"nofollow noopener noreferrer\">Flashpoints</A></EM>. Bernstein will then join Lehrer to present their new book and multimedia project, <A HREF=\"https://fiveoceansinateaspoon.com/\" TARGET=\"_blank\" REL=\"nofollow noopener noreferrer\"><EM>Five Oceans in a Teaspoon</EM></A>. A collection of short visual poems divided into 8 movements, the 300-page book sits at the center of a multi-tiered project that includes typographic animations, a traveling exhibit, and performance/readings.</P>\n<P><BR></P>\n<P>Copies of <EM>Five Oceans in a Teaspoon</EM> will be available for sale at the event. A book signing by Lehrer and Bernstein will follow the talk.</P>\n<P>Doors at 6:00pm. Presentation begins promptly at 6:30pm.</P>\n<P><BR></P>"
